"""
This simple script attempts to estimate a pulse from received data.

The algorythm uses a simple median filter to smooth noisy measurments and then finds maximum local values.
Then, with known time between measurments 
"""
def median_filter(tab,n=50):  # tab -source data # n - frame width
    new_answer=[]
    for i in range(len(tab)-n):
        tmp_median=0
        for j in range(n):
            tmp_median+=tab[i+j]
        tmp_median=tmp_median/n
        new_answer.append(tmp_median)
    return np.array(new_answer)

def find_local_max(tab,epsilon=20):        # finds local maximum values and returns their indexes , epsilon spefifies width 
    length=len(tab)                              
    is_extreme=True
    answer=[]

    for i in range(length):
        for j in range(epsilon):
            if (i-j)>=0:
                if tab[i]<tab[i-j]:
                    is_extreme=False
            if (i+j)<=length-1:
                if tab[i]<tab[i+j]:
                    is_extreme=False
        if len(answer)>0:
            if is_extreme:
                if tab[answer[-1]]!=tab[i]:
                    answer.append(i)
        else:
            if is_extreme:
                answer.append(i)
        is_extreme=True
    return answer



